import React from "react"
import "./Style.css"
import axios from "axios"

function SignUp(){
const [name,setname]=React.useState("")
const [Email,setEmail]=React.useState("")
const [password,setpassword]=React.useState("")
const [passwordR,setpasswordR]=React.useState("")
const [Accept,setAccept]=React.useState(false)
const [Erorr,setErorr]=React.useState("")

async function Submite(e){
    let Flag=true
    e.preventDefault()
    setAccept(true)
    if(name===''||password.length<8||passwordR!==password){
        Flag=false
    }else{
        Flag=true
    }
    try{
    if(Flag){
    let res=await axios.post('http://127.0.0.1:8000/api/register',{
        name:name,
        email:Email,
        password:password,
        password_confirmation:passwordR
     }).then((t)=>console.log(t))
     if(res.status===200){
        window.location.pathname="/"
     }
    }
    
}
catch(eror){
    setErorr(eror.response.status)

}
}

return(
<div className="Father">
<form onSubmit={Submite}>
<label htmlFor="in1">Name</label>
<input id="in1" type="text" placeholder="Name..." value={name} onChange={(e)=>setname(e.target.value)}  />
{Accept&&name.length<=1&&<p className="Eroor">User name is Required</p>}
<label htmlFor="in2">Email</label>
<input id="in2" type="email" placeholder="Email..." value={Email}  onChange={(e)=>setEmail(e.target.value)}  />
{ Erorr===422&&Accept&&<p className="Eroor"> The Email is Used</p>}
<label htmlFor="in3">Password</label>
<input id="in3" type="password" placeholder="password..."value={password}  onChange={(e)=>setpassword(e.target.value)}  />
{password.length<8&&Accept&&<p className="Eroor">The password is mpre the 8</p>}
<label htmlFor="in4">Rebet Password</label>
<input id="in4" type="password" placeholder="Rebet Password..."value={passwordR}  onChange={(e)=>setpasswordR(e.target.value)}  />
{passwordR!==password &&Accept&&<p className="Eroor">The password Not input the First</p>}

<div style={{textAlign:"center"}}>
<button className="btn">Register</button>
</div>
</form>
</div>
    )
}
export default SignUp
